Let's supposes we've implemented a MySet data structure. It has 3 operations: insert(value) - inserts an value into the set remove(value) - removes an value from the set clear() - removes all values from the set The operations can easily be modeled as an enum: use bolero::generator::TypeGenerator; #[derive(Debug, TypeGenerator)]
enum Operation { Insert(u64), Remove(u64), Clear,
} Note that we've added TypeGenerator to the list of derives. This enables bolero to generate random values for Operation. We can combine that with a Vec<Operation> and get a list of operations to perform on our MySet data structure. use bolero::{check, generator::*};
use my_set::MySet; #[derive(Debug, TypeGenerator)]
enum Operation { Insert(u64), Remove(u64), Clear,
} fn main() { check!() .with_type::<Vec<Operation>>() .for_each(|operations| { let mut set = MySet::new(); for operation in operations.iter() { match operation { Operation::Insert(value) => { set.insert(value); } Operation::Remove(value) => { set.remove(value); } Operation::Clear => { set.clear(); } } } })
} This basic test will make sure we don't panic on any of the list of operations. We can take it to the next step by using a test oracle to make sure the behavior of MySet is actually correct. Here we'll use HashSet from the std library: use bolero::{check, generator::*};
use my_set::MySet;
use std::collections::HashSet; #[derive(Debug, TypeGenerator)]
enum Operation { Insert(u64), Remove(u64), Clear,
} fn main() { check!() .with_type::<Vec<Operation>>() .for_each(|operations| { let mut set = MySet::new(); let mut oracle = HashSet::new(); for operation in operations.iter() { match operation { Operation::Insert(value) => { set.insert(value); oracle.insert(value); } Operation::Remove(value) => { set.remove(value); oracle.remove(value); } Operation::Clear => { set.clear(); oracle.clear(); } } } assert!(set.iter().eq(oracle.iter())); })
}

